func lengthOfLongestSubstring(s string) int {
	length := 0
	for d:=0; d<len(s); d++ {
		subLength := lols(s, d)
		if subLength > length {
			length = subLength
		}
	}

	return length
}

func ifInRune(r []rune, c rune) (ifIn bool) {
	ifIn = false
	for _, value := range r {
		if c == value {
			ifIn = true
			break
		}
	}
	return
}

func lols(s string, d int) (length int) {
	length = 0
	for i:=d; i<len(s); i++ {
		rl := []rune{}
		for j:=d; j<len(s); j++ {
			if ifInRune(rl, rune(s[j])) {
				break
			} else {
				rl = append(rl, rune(s[j]))
			}
		}
		if length < len(rl) {
			length = len(rl)
		}
	}
	fmt.Println(len(s), d, length)
	return length
}

